(44, '脚部静态块', 'footer_static', '<div class="f-col col-sm-6 col-md-3 col-sms-6 col-smb-12">\r\n<div class="footer-static-title f-title1">\r\n<h3>服务领域</h3>\r\n</div>\r\n<div class="footer-static-content">\r\n<p>WinPower Creation专注于产品开发、产品设计和定制服务三大板块。多元化的团队不仅专注于产品开发的独立品牌,也为不同客户需求提供不同的解决方案。</p>\r\n<div class="f-name">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class="f-col f-col2 col-sm-6 col-md-2 col-sms-6 col-smb-12">\r\n<div class="footer-static-title f-title2">\r\n<h3>账户信息</h3>\r\n</div>\r\n<div class="footer-static-content row-fluid">\r\n<ul>\r\n<li class="first"><a href="{{store direct_url="catalog/seo_sitemap/category"}}">网站地图</a></li>\r\n<li><a href="{{store direct_url="privacy-policy-cookie-restriction-mode"}}">隐私策略</a></li>\r\n<li><a href="{{store direct_url="customer/account/index"}}">我的账户</a></li>\r\n<li><a href="{{store direct_url="catalogsearch/advanced"}}">先进搜索</a></li>\r\n<li class="last"><a href="{{store direct_url="contacts"}}">联系我们</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="f-col f-col3 col-sm-6 col-md-2 col-sms-6 col-smb-12">\r\n<div class="footer-static-title f-title3">\r\n<h3>信息</h3>\r\n</div>\r\n<div class="footer-static-content">\r\n<ul>\r\n<li class="first"><a href="{{store direct_url="customer/account/index/"}}">我的账户</a></li>\r\n<li><a href="sales/order/history/">订单历史</a></li>\r\n<li><a href="#">Returns</a></li>\r\n<li><a href="#">Specials</a></li>\r\n<li class="last"><a href="{{store direct_url="catalog/seo_sitemap/category"}}">网站地图</a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class="f-col f-col3 col-sm-6 col-md-2 col-sms-6 col-smb-12">\r\n<div class="footer-static-title f-title4">\r\n<h3>我们的优势</h3>\r\n</div>\r\n<div class="footer-static-content">\r\n<ul>\r\n<li class="first"><a href="{{store direct_url="catalog/seo_sitemap/category"}}">网站地图</a></li>\r\n<li><a href="#">特色</a></li>\r\n<li><a href="#">回报</a></li>\r\n<li><a href="sales/order/history/">订单历史</a></li>\r\n<li class="last"><a href="{{store direct_url="customer/account/index/"}