(45, '头部静态块', 'header_static', '<div class="header-static">\r\n<div class="container">\r\n<div class="row">\r\n<div class="f-col col-sm-6 col-md-3 col-sms-6 col-smb-12">\r\n<div class="header-time">\r\n<h2>营业时间</h2>\r\n<p>工作日：10:00 AM - 17:00 PM</p>\r\n</div>\r\n</div>\r\n<div class="f-col col-sm-6 col-md-3 col-sms-6 col-smb-12">\r\n<div class="header-shipping">\r\n<h2>满额包邮</h2>\r\n<p>超过 S$200</p>\r\n</div>\r\n</div>\r\n<div class="f-col col-sm-6 col-md-3 col-sms-6 col-smb-12">\r\n<div class="header-money">\r\n<h2>设计服务</h2>\r\n<p>7天退款保证</p>\r\n</div>\r\n</div>\r\n<div class="f-col col-sm-6 col-md-3 col-sms-6 col-smb-12">\r\n<div class="header-phone">\r\n<h2>电话: +65-6235 9912</h2>\r\n<p>马上订购吧 !</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2014-12-24 10:38:53', '2015-01-23 10:26:33', 1);
